import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";
import { loadPrice } from "../redux/actions";



function Home() {

  let dispatch = useDispatch();
  const { prices } = useSelector((state) => state.prices);

  useEffect(() => {
    dispatch(loadPrice());
  }, []);

  console.log("value of API",prices)

  return (
    <div >
        <div className="flex flex-row  justify-between ">
      <div class="flex mt-4 ">
        <div class="flex-none  text-center outline  outline-1 rounded-full px-2  ">
          on Sale
        </div>
        <div class="flex-none outline-offset-2 outline-1 rounded-full px-6 mx-4 bg-gray-200">
          All
        </div>
     
      </div>

      <div class="flex py-4 ">
        <div className=" px-2 border rounded-lg">
            Higher Prices â–¼
        </div>
        
        </div>
        </div>
    
          {prices?.length > 0 &&
            prices.map((dollarprice) => (
             
      <div class="grid grid-cols-3 gap-4 px-4 py-6">
        <div>
          <div class="box-border h-32 w-full p-4 border-4"></div>
          <div className="flex items-center">
            <img
              src="https://lh3.googleusercontent.com/XmyBR5GdMLYJ1FUmY81C-sdw1D-o5xh3RNzkhUm7iRjS9GJm3cbMfXbBY0PfzlqCOQZZ=s85"
              className=" w-8  h-auto inline-block"
              alt="Logo"
            />
            <div className="px-2">
              <strong>Creator</strong>
              <br />
              <span className="text-sm"> Art Title Something</span>
            </div>
          </div>
          <div>
            <h1>{dollarprice.price}</h1>
          </div>
        </div>

        </div>

  
            ))}  
                </div>

  );
}

export default Home;
